<template lang="pug">
v-container
  v-card {{ item.name }}
    img(:src="'data:image/jpeg;base64,' + this.imageBase64")
</template>

<script>
import ItemService from "@/services/Item";

export default {
  name: "Item",

  props: ["item"],

  data() {
    return {
      imageBase64:
        "",
    };
  },

  methods: {
    loadImage() {
      console.log("Loading icon for " + this.item.name);
      this.imageBase64 = ItemService.icon(this.item.uniqueName);
    },
  },

  mounted() {
    this.loadImage();
  },
};
</script>